            </li>
            <li className = "nav-item">
              <a className = "nav-link" href="/clients">Clients</a>
            </li>
            <li className = "nav-item">
              <a className = "nav-link" href="/projects">Projects</a>
            </li>
            <li className = "nav-item">
              <a className = "nav-link" href="#">Invoices</a>
            </li>
          </ul>
        </span>
      </div> 
    </nav>

